import React from 'react';
import './App.scss';
import InputField from './components/InputField/InputField';
import SectionHeader from './components/SectionHeader/SectionHeader';

const App: React.FC = () => {
  return (
    <div className="hcard-builder">
      <div className="hcard-builder-container">
        <div className="form-container">
          <h1>hCard Builder</h1>
          <SectionHeader label="Personal details"></SectionHeader>
          <div className="form-row">
            <InputField label="Given name" name="Given name" type="text"/>
            <InputField label="Last name" name="Last name" type="text"/>
          </div>
          <div className="form-row">
            <InputField label="Email" name="Email" type="email"/>
            <InputField label="Phone" name="Phone" type="tel"/>
          </div>
        </div>
        <div className="preview-container"></div>
      </div>
    </div>
  );
}

export default App;
